import { useEffect } from 'react';
import useAuthContext from '../context/AuthContext';

export const Home = () => {
  const { user, getUser } = useAuthContext();
  useEffect(() => {

      if(!user){
        getUser();
      }

  }, []);

  return (
    <div>{ user?.name}</div>
  )
}
